import React, { Component } from 'react'

export class BookedItem extends Component {
  render() {
    //get data from booking history and pass to booked items
    return (
      <div>
        <div className="card">
            <div className="card-body">
                <img className="img-thumbnail" src={this.props.bookingdetails.ImageUrl[0]} alt={this.props.bookingdetails.EventName} />
                <h5 className="card-title"> {this.props.bookingdetails.EventName}</h5>
                <p>Booking Reference : {this.props.bookingdetails.BookingReference}</p>                
                <p>Club/Restaurant : {this.props.bookingdetails.RestaurantName}</p>
                <p>Date : {this.props.bookingdetails.Date}</p>
                <p>Timings : {this.props.bookingdetails.Timings}</p>
            </div>
        </div>
    </div>
    )
  }
}

export default BookedItem
